Reposted from @cartergood "Am I going to have to do this forever?" 

I've had several clients ask me that question over the years.

And the unsexy truth is... "yes." 

If you want to have a lean & healthy body forever, you're going to have to make fitness a priority for the rest of your life.

Kind of a no-brainer, right?

Well, even though it makes total sense, it can still be discouraging for people to hear.

Maybe it's discouraging for you to hear right now...

If so, remember this:

The longer you do something, the easier it gets.

For example, your job is easier now than when you first started it.

Not because there's less effort involved, but because you've become more comfortable with how to properly & effectively do your job.

Fitness is the exact same!

The more you work out and prioritize nutrition, the easier (and more comfortable) it becomes to continue doing those things â€” especially once you start to see and feel positive results.

~

The Bottom Line:

The sooner you can accept that fitness will to be a part of your life forever, the sooner you can escape the need for short-term motivation and start trusting the long-term process.

It's not the sexiest answer... it's not something I can sell for 3 easy-peasy payments of $29.99...

But it's the truth.

You got this. 

â€“ Carter 

